import React from 'react'

function ObituaryForm() {
  return (
      <div className='d-flex vh-100 bg-light grey justify-content-center align-items-center'>
          <div className='w-50 bg-secondary rounded p-3'>
              <form>
                  <h2>Person's Information</h2>
              </form>
          </div>
    </div>
  )
}

export default ObituaryForm
